import React from 'react';
import './motives.css';
import {Container, Row, Col, Image} from 'react-bootstrap';
import Header from '../../common/sectionHeader/sectionHeader.js';
import Pollusion from '../../../media/pollusion-img.png';

function motives() {
    return (
        <section className = "motives" id = "motives">
            <Container>
                <Header effectType = "fade-up" headerText = "Motives" contentText = "Learn about the motives behind our solution"></Header>
                <Row>
                    <Col lg = {4}>
                        <Image src = {Pollusion} fluid></Image>
                    </Col>
                </Row>
                

            </Container>
        </section>
    )
}

export default motives
